import React from 'react';

const Navbar = props =>(
    <div className="toolbar">
        <nav className="navigation_bar">
           
            <div className="navigation_items">
            <a href='/Login' class="btn btn-info btn-rounded btn-sm waves-effect waves-light auth-modal-toggle" >Login</a>
            </div>
    
        </nav>
    </div>
)

export default Navbar;
